import React from "react";
import { List, Card, Avatar } from "antd";
import blockchain from "./blockchain.jpg";

export default function technologies() {
  const data = [
    {
      title: "Title 1",
      src: { blockchain }
    },
    {
      title: "Title 2"
    },
    {
      title: "Title 3"
    },
    {
      title: "Title 4"
    },
    {
      title: "Title 5"
    },
    {
      title: "Title 6"
    }
  ];
  return (
    <div>
      <List
        grid={{
          gutter: 16,
          xs: 1,
          sm: 2,
          md: 4,
          lg: 4,
          xl: 6,
          xxl: 3
        }}
        dataSource={data}
        renderItem={item => (
          <List.Item>
            <Card title={item.title}>Card content</Card>
            <Avatar shape="square" size={64} src={item.src} />
            <img src={blockchain} />
          </List.Item>
        )}
      />
    </div>
  );
}
